// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";


contract BasicDEX is ReentrancyGuard {
    IERC20 public token0;
    IERC20 public token1;

    uint public reserve0;
    uint public reserve1;

    uint public totalLiquidity;
    mapping(address => uint) public liquidity;

    constructor(address _token0, address _token1) {
        token0 = IERC20(_token0);
        token1 = IERC20(_token1);
    }

    function getLiquidityAmount(
        uint amountA, 
        bool isToken0
    ) external view returns (
        uint requiredOtherToken,
        uint expectedLiquidity
    ) {
        require(amountA > 0, "Invalid input amount");

        // If first liquidity provision
        if (totalLiquidity == 0) {
            requiredOtherToken = amountA; // For first provision, ratio can be anything
            expectedLiquidity = sqrt(amountA * requiredOtherToken);
        } else {
            // Calculate required amount based on current ratio
            uint reserveA = isToken0 ? reserve0 : reserve1;
            uint reserveB = isToken0 ? reserve1 : reserve0;

            // Calculate required other token to maintain ratio
            requiredOtherToken = (amountA * reserveB) / reserveA;

            // Calculate expected liquidity tokens
            expectedLiquidity = (amountA * totalLiquidity) / reserveA;
        }

        require(requiredOtherToken > 0, "Invalid required amount");
    }

    function addLiquidity(uint amount0, uint amount1) external nonReentrant returns (uint liquidityMinted) {
        // Transfer tokens to contract
        token0.transferFrom(msg.sender, address(this), amount0);
        token1.transferFrom(msg.sender, address(this), amount1);

        // Calculate liquidity tokens to mint
        uint _totalLiquidity = totalLiquidity;
        if (_totalLiquidity == 0) {
            liquidityMinted = sqrt(amount0 * amount1);
            require(liquidityMinted > 0, "Insufficient liquidity minted");
        } else {
            uint liquidity0 = (amount0 * _totalLiquidity) / reserve0;
            uint liquidity1 = (amount1 * _totalLiquidity) / reserve1;
            liquidityMinted = liquidity0 < liquidity1 ? liquidity0 : liquidity1;
        }

        require(liquidityMinted > 0, "Insufficient liquidity minted");

        // Update reserves and liquidity
        reserve0 += amount0;
        reserve1 += amount1;
        liquidity[msg.sender] += liquidityMinted;
        totalLiquidity += liquidityMinted;
    }

    function removeLiquidity(uint liquidityAmount) external nonReentrant returns (uint amount0, uint amount1) {
        require(liquidity[msg.sender] >= liquidityAmount, "Insufficient liquidity");

        // Calculate tokens to return
        amount0 = (liquidityAmount * reserve0) / totalLiquidity;
        amount1 = (liquidityAmount * reserve1) / totalLiquidity;

        require(amount0 > 0 && amount1 > 0, "Insufficient liquidity to remove");

        // Update state
        liquidity[msg.sender] -= liquidityAmount;
        totalLiquidity -= liquidityAmount;
        reserve0 -= amount0;
        reserve1 -= amount1;

        // Transfer tokens back to user
        token0.transfer(msg.sender, amount0);
        token1.transfer(msg.sender, amount1);
    }

    function swap(uint amountIn, uint minAmountOut, bool token0ToToken1) external nonReentrant returns (uint amountOut) {
        require(amountIn > 0, "Invalid input amount");

        amountOut = getSwapAmount(amountIn, token0ToToken1);
        require(amountOut >= minAmountOut, "Insufficient output amount");

        // Transfer tokens
        if (token0ToToken1) {
            token0.transferFrom(msg.sender, address(this), amountIn);
            token1.transfer(msg.sender, amountOut);
            reserve0 += amountIn;
            reserve1 -= amountOut;
        } else {
            token1.transferFrom(msg.sender, address(this), amountIn);
            token0.transfer(msg.sender, amountOut);
            reserve1 += amountIn;
            reserve0 -= amountOut;
        }
    }

    // New helper function to calculate swap output amount
    function getSwapAmount(uint amountIn, bool token0ToToken1) public view returns (uint amountOut) {
        require(amountIn > 0, "Invalid input amount");
        require(reserve0 > 0 && reserve1 > 0, "Insufficient liquidity");

        uint reserveIn = token0ToToken1 ? reserve0 : reserve1;
        uint reserveOut = token0ToToken1 ? reserve1 : reserve0;

        // Fee of 0.3%
        uint amountInWithFee = amountIn * 997;
        amountOut = (amountInWithFee * reserveOut) / (reserveIn * 1000 + amountInWithFee);
    }

    // Helper function to calculate square root
    function sqrt(uint y) internal pure returns (uint z) {
        if (y > 3) {
            z = y;
            uint x = y / 2 + 1;
            while (x < z) {
                z = x;
                x = (y / x + x) / 2;
            }
        } else if (y != 0) {
            z = 1;
        }
    }

    // View functions
    function getReserves() external view returns (uint _reserve0, uint _reserve1) {
        return (reserve0, reserve1);
    }

    function getUserLiquidity(address user) external view returns (uint) {
        return liquidity[user];
    }
}

